import React, { Component } from 'react'
import CourseWork from '../CourseWork/CourseWork'

interface Props{
    data :{
        title?: string,
        teacher?: string,
        deadline?: string,
        scienceArea?: string,
        description?: string,
        reportFile?: string,
        presentationFile?: string,
        consultantReportFile?: string,
        link?: string,
        teacherContacts?: string,
        consultant?: string,
        consultantContacts?: string,
        critic?: string,
        status?: string
    }[]
}

interface State{

}

class CompletedWorks extends Component<Props,State>{
    constructor(props : Props){
        super(props);
        this.state={}
    }

    private renderContentBar(){
        return(
            <div>
                <h1>COMPLETED</h1>
            </div>
        )
    }

    render(){
        return this.renderContentBar();
    }
}

export default CompletedWorks
